const NAME = 'NAME'

initialState={
    name: ''
}


export const reducerStateName=(state, action)=>{
    switch(action.type){
        case NAME:{
            return {...state.name, name}
        }
        default:
            return state
    }
}

export const Name=(name)=>({type: NAME, name})
